(11, 'we-are-one-of-the-most-trusted-staffing-agencies-in-seattle', 'We Are One Of The Most Trusted Staffing Agencies in Seattle', 'Dependable Staffing Agency helps provide our clients compassionate and professional nursing services for the supplemental staffing needs for the facilities in the health care industry.', '<p style=\"margin-right: 0px; margin-bottom: 1.25em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(25, 23, 23); text-align: center; background-color: rgb(255, 255, 255);\">Its rare to find enthusiasm, dedication, and insight in a single employee, much less an entire team. But just like we find exceptional hires for our clients, weve found them for ourselves. The Dependable Staffing Agency team loves to come to work every day because we love what we do and that is our secret to success.</p><p style=\"margin-right: 0px; margin-bottom: 1.25em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(25, 23, 23); text-align: center; background-color: rgb(255, 255, 255);\">Through Dependable Staffing Agency, talented contract consultants in Seattle and surrounding markets find opportunities for rewarding work in their fields of expertise with leading Washington companies every day. Dependable Staffing Agency is interested in building careers by offering outstanding benefits to our Seattle staffing consultants. We always invest in a long-term approach because we are committed to helping you reach your career goals.</p><p style=\"margin-right: 0px; margin-bottom: 1.25em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(25, 23, 23); text-align: center; background-color: rgb(255, 255, 255);\">And that is why our company Dependable Staffing Agency is the best Staffing Agency in Seattle and one of the few trusted Staffing Agencies in Seattle, Washington.</p>', NULL, NULL, NULL),
(12, 'request-talent-for-employer-needs', 'Request Talent for Employer Needs', 'Connecting you with the best talent in Seattle for more than 30 years', NULL, NULL, NULL, NULL),
(13, 'request-talent-form', 'Request Talent Form', 'At Dependable Staffing, we are committed to matching you with the most qualified individuals for your companys needs. Complete the form below with your information to find the right professional today.', '<p><span style=\"color: rgb(25, 23, 23); font-family: Poppins, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">Information provided to Dependable Staffing Agency will not be transferred, disclosed, or used for marketing purposes</span><br></p>', NULL, NULL, NULL),
(14, 'about-dependable-staffing-agency', 'About Dependable Staffing Agency', 'Providing the highest quality and professional services since 1989.', NULL, NULL, NULL, NULL),
(15, 'the-best-temp-agency-in-federal-way', 'The Best Temp Agency In Federal Way', 'The Best Temp Agency In Federal Way Dependable Staffing Agency is the best Temp Agency In Federal Way and is recognized as one of the most trusted Temp Agencies In Seattle, Washington.', '<p class=\"text-left\" style=\"margin-right: 0px; margin-bottom: 1.25em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(25, 23, 23); background-color: rgb(255, 255, 255);\">Dependable Staffing Agency was founded in 1989 with a genuine desire to offer quality, compassionate, and professional skilled and non-skilled services. We are committed to providing a caring service that respects the personal values and dignity of our clients whom we serve in our community. We run a professional Temp Agency In Federal Way.</p><p class=\"text-left\" style=\"margin-right: 0px; margin-bottom: 1.25em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(25, 23, 23); background-color: rgb(255, 255, 255);\">Our focus is to provide fully trained and qualified health professionals to meet high-quality staffing needs at hospitals, clinics, long-term care facilities, adult family homes, &amp; adult day care centers along with providing home health services during the transition from independence to increased reliance upon others. Previously, Dependable Staffing Agencys services had mainly been geared toward the medical industry. We are proud to announce that we are now providing staffing services for a multitude of industries outside of the medical field and we are recognized as one the best Temp Agencies In Seattle. Please browse our Who We Hire section to see other industries in which we may serve you to meet your business needs!</p>', '16704956885518.png', NULL, '2022-12-08 05:04:48'),
(16, 'why-choose-us', 'Why choose Us?', NULL, '<p>We are committed to working as a team player of the facility wherever and whenever we are needed. Our professionals will follow the policies and procedures of the facility. In addition, we provide solutions for the entire employment and business cycle including permanent, temporary and contract recruitment, employee assessment and selection along with job placement and consulting. Our combination of high-quality training and real-world experience helps equip all workers for success in their professional careers.<br></p>', '16704784719620.jpg', NULL, NULL),
(17, '30', '30', 'Years of', 'Experience', NULL, NULL, NULL),
(18, 'dependable-staffing-agency-is-one-of-the-most-trusted-temp-agencies-in-seattle', 'Dependable Staffing Agency Is One Of The Most Trusted Temp Agencies In Seattle', NULL, '<p><span style=\"color: rgb(25, 23, 23); font-family: Poppins, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">We are the best Staffing Agency in Seattle because we provide 24 hour-a-day, 7 days a week care for clients in their home and in various settings, including nursing homes, boarding homes, assisted living, and retirement communities.We uphold the highest ethical, professional and performance standards possible. We deeply value the trust and confidence that our clients and patients have consistently placed in us over time. To ensure we only provide the highest quality skilled professionals for your needs, we employ a meticulous screening process for hiring our employees. We endeavor to hire only the best trained &amp; most qualified service professionals available. We appreciate your interest and we hope that we can be of service to you in the future. And that is why we are said to be one of the best Temp Agencies In Seattle. If you would like additional information, you can reach us anytime  we are available 24 hours per day, seven days a week. Please feel free to call (253) 252-3957.</span><br></p>', NULL, NULL, NULL),
(19, 'job-placement', 'Job Placement', NULL, '<p>Dependable Staffing Agency develops and empowers the next generation of professionals with the highest quality training and educational experience possible. At Dependable Staffing Agency, your success is our success! For more information, please call (253) 252-3957.<br></p>', NULL, NULL, NULL),
(20, 'facility-intake-form', 'Facility Intake Form', NULL, '<h5 style=\"margin-right: 0px; margin-bottom: 1rem; margin-left: 0px; font-weight: 600; line-height: 1.21; font-size: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Montserrat, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: initial; text-align: center; background-color: rgb(255, 255, 255);\">At Dependable Staffing, we are committed to matching you with the most qualified individuals for your companys needs. Complete the form below with your information to find the right professional today.</h5>', '16704794462065.png', NULL, NULL),
(21, 'submit-resume-form', 'Submit Resume Form', 'Information provided to Dependable Staffing Agency will not be transferred, disclosed, or used for marketing purposes.', '<h5 style=\"margin-right: 0px; margin-bottom: 1rem; margin-left: 0px; font-weight: 600; line-height: 1.21; font-size: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Montserrat, sans-serif; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: initial; text-align: center; background-color: rgb(255, 255, 255);\">At Dependable Staffing, we are committed to matching you with the best jobs in the market. Complete the form below with your information and take the first step in your new career.</h5>', NULL, NULL, NULL);

